/**
 * 检查虚拟主机配置
 */


var error = 0;
var warning = 0;
var app = {
    init:function(){
        error = 0;
        warning = 0;
    }
};
module.exports = function(config){
    for(var p in app){
        app[p](config);
    }
    console.log('Config check - Warning : ' + warning + '/' + index + ' ; Error : ' + error + '/' + index + ' ; ')
};